pragma solidity ^0.8.0;

import './Utils.sol';


library Pairing {

    /// @return the generator of G1
    function P1() pure internal returns (Utils.G1Point memory) {
        return Utils.G1Point(1, 2);
    }
    /// @return the generator of G2
    function P2() pure internal returns (Utils.G2Point memory) {
        return Utils.G2Point(
            [10857046999023057135944570762232829481370756359578518086990519993285655852781,
             11559732032986387107991004021392285783925812861821192530917403151452391805634],
            [8495653923123431417604973247489272438418190587263600148770280649306958101930,
             4082367875863433681332203403145435568316851327593401208105741076214120093531]
        );
    }
    /// @return the negation of p, i.e. p.addition(p.negate()) should be zero.
    function negate(Utils.G1Point memory p) pure internal returns (Utils.G1Point memory) {
        // The prime q in the base field F_q for G1
        uint q = 21888242871839275222246405745257275088696311157297823662689037894645226208583;
        if (p.X == 0 && p.Y == 0)
            return Utils.G1Point(0, 0);
        return Utils.G1Point(p.X, q - (p.Y % q));
    }
    /// @return r the sum of two points of G1
    function addition(Utils.G1Point memory p1, Utils.G1Point memory p2) internal view returns (Utils.G1Point memory r) {
        uint[4] memory input;
        input[0] = p1.X;
        input[1] = p1.Y;
        input[2] = p2.X;
        input[3] = p2.Y;
        bool success;
        assembly {
            success := staticcall(sub(gas(), 2000), 6, input, 0xc0, r, 0x60)
            // Use "invalid" to make gas estimation work
            switch success case 0 { invalid() }
        }
        require(success);
    }


    /// @return r the product of a point on G1 and a scalar, i.e.
    /// p == p.scalar_mul(1) and p.addition(p) == p.scalar_mul(2) for all points p.
    function scalar_mul(Utils.G1Point memory p, uint s) internal view returns (Utils.G1Point memory r) {
        uint[3] memory input;
        input[0] = p.X;
        input[1] = p.Y;
        input[2] = s;
        bool success;
        assembly {
            success := staticcall(sub(gas(), 2000), 7, input, 0x80, r, 0x60)
            // Use "invalid" to make gas estimation work
            switch success case 0 { invalid() }
        }
        require (success);
    }
    /// @return the result of computing the pairing check
    /// e(p1[0], p2[0]) *  .... * e(p1[n], p2[n]) == 1
    /// For example pairing([P1(), P1().negate()], [P2(), P2()]) should
    /// return true.
    function pairing(Utils.G1Point[] memory p1, Utils.G2Point[] memory p2) internal view returns (bool) {
        require(p1.length == p2.length);
        uint elements = p1.length;
        uint inputSize = elements * 6;
        uint[] memory input = new uint[](inputSize);
        for (uint i = 0; i < elements; i++)
        {
            input[i * 6 + 0] = p1[i].X;
            input[i * 6 + 1] = p1[i].Y;
            input[i * 6 + 2] = p2[i].X[1];
            input[i * 6 + 3] = p2[i].X[0];
            input[i * 6 + 4] = p2[i].Y[1];
            input[i * 6 + 5] = p2[i].Y[0];
        }
        uint[1] memory out;
        bool success;
        assembly {
            success := staticcall(sub(gas(), 2000), 8, add(input, 0x20), mul(inputSize, 0x20), out, 0x20)
            // Use "invalid" to make gas estimation work
            switch success case 0 { invalid() }
        }
        require(success);
        return out[0] != 0;
    }
    /// Convenience method for a pairing check for two pairs.
    function pairingProd2(Utils.G1Point memory a1, Utils.G2Point memory a2, Utils.G1Point memory b1, Utils.G2Point memory b2) internal view returns (bool) {
        Utils.G1Point[] memory p1 = new Utils.G1Point[](2);
        Utils.G2Point[] memory p2 = new Utils.G2Point[](2);
        p1[0] = a1;
        p1[1] = b1;
        p2[0] = a2;
        p2[1] = b2;
        return pairing(p1, p2);
    }
    /// Convenience method for a pairing check for three pairs.
    function pairingProd3(
            Utils.G1Point memory a1, Utils.G2Point memory a2,
            Utils.G1Point memory b1, Utils.G2Point memory b2,
            Utils.G1Point memory c1, Utils.G2Point memory c2
    ) internal view returns (bool) {
        Utils.G1Point[] memory p1 = new Utils.G1Point[](3);
        Utils.G2Point[] memory p2 = new Utils.G2Point[](3);
        p1[0] = a1;
        p1[1] = b1;
        p1[2] = c1;
        p2[0] = a2;
        p2[1] = b2;
        p2[2] = c2;
        return pairing(p1, p2);
    }
    /// Convenience method for a pairing check for four pairs.
    function pairingProd4(
            Utils.G1Point memory a1, Utils.G2Point memory a2,
            Utils.G1Point memory b1, Utils.G2Point memory b2,
            Utils.G1Point memory c1, Utils.G2Point memory c2,
            Utils.G1Point memory d1, Utils.G2Point memory d2
    ) internal view returns (bool) {
        Utils.G1Point[] memory p1 = new Utils.G1Point[](4);
        Utils.G2Point[] memory p2 = new Utils.G2Point[](4);
        p1[0] = a1;
        p1[1] = b1;
        p1[2] = c1;
        p1[3] = d1;
        p2[0] = a2;
        p2[1] = b2;
        p2[2] = c2;
        p2[3] = d2;
        return pairing(p1, p2);
    }
}

contracts/Paymaster.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.6;

import "@opengsn/contracts/src/forwarder/IForwarder.sol";
import '@opengsn/contracts/src/BasePaymaster.sol';
import '@opengsn/contracts/src/utils/GsnTypes.sol';

contract Paymaster is BasePaymaster {
    address public ourTarget;

    event TargetSet(address target);

    function setTarget(address target) external onlyOwner {
        ourTarget = target;
        emit TargetSet(target);
    }

    function versionPaymaster() external view override virtual returns (string memory){
        return "3.0.0-beta.2+opengsn.test-pea.ipaymaster";
    }

    function deposit() public payable {
        require(address(relayHub) != address(0), "relay hub address not set");
        relayHub.depositFor{value:msg.value}(address(this));
    }

    function _preRelayedCall(
        GsnTypes.RelayRequest calldata relayRequest,
        bytes calldata signature,
        bytes calldata approvalData,
        uint256 maxPossibleGas
    ) internal view override returns (bytes memory context, bool rejectOnRecipientRevert) {
        (relayRequest, signature);
        (approvalData, maxPossibleGas);
        return ("no revert here",false);
    }

    function _postRelayedCall(
        bytes calldata context,
        bool success,
        uint256 gasUseWithoutPost,
        GsnTypes.RelayData calldata relayData
    ) internal view override{
        (context, success, gasUseWithoutPost, relayData);
    }
}

contracts/RegisterUpkeeper.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// UpkeepIDConsumerExample.sol imports functions from both ./AutomationRegistryInterface1_2.sol and
// ./interfaces/LinkTokenInterface.sol

import {AutomationRegistryInterface, State, Config} from "@chainlink/contracts/src/v0.8/interfaces/AutomationRegistryInterface1_2.sol";
import {LinkTokenInterface} from "@chainlink/contracts/src/v0.8/interfaces/LinkTokenInterface.sol";

/**
 * THIS IS AN EXAMPLE CONTRACT THAT USES HARDCODED VALUES FOR CLARITY.
 * THIS IS AN EXAMPLE CONTRACT THAT USES UN-AUDITED CODE.
 * DO NOT USE THIS CODE IN PRODUCTION.
 */

interface KeeperRegistrarInterface {
    function register(
        string memory name,
        bytes calldata encryptedEmail,
        address upkeepContract,
        uint32 gasLimit,
        address adminAddress,
        bytes calldata checkData,
        uint96 amount,
        uint8 source,
        address sender
    ) external;
}

contract RegisterUpkeeper {
    LinkTokenInterface public immutable i_link;
    address public registrar;
    AutomationRegistryInterface public i_registry;
    bytes4 registerSig = KeeperRegistrarInterface.register.selector;

    event UpkeeperID(uint256 upkeepID);

    constructor(
        LinkTokenInterface _link,
        address _registrar,
        AutomationRegistryInterface _registry
    ) {
        i_link = _link;
        registrar = _registrar;
        i_registry = _registry;
    }

    function registerAndPredictID(
        string memory name,
        bytes calldata encryptedEmail,
        address upkeepContract,
        uint32 gasLimit,
        address adminAddress,
        bytes calldata checkData,
        uint96 amount,
        uint8 source
    ) external {
        (State memory state, Config memory _c, address[] memory _k) = i_registry.getState();
        uint256 oldNonce = state.nonce;
        bytes memory payload = abi.encode(
            name,
            encryptedEmail,
            upkeepContract,
            gasLimit,
            adminAddress,
            checkData,
            amount,
            source,
            address(this)
        );
/*
        i_link.transferAndCall(
            registrar,
            amount,
            bytes.concat(registerSig, payload)
        );
        */
        (state, _c, _k) = i_registry.getState();
        uint256 newNonce = state.nonce;
        if (newNonce == oldNonce + 1) {
            uint256 upkeepID = uint256(
                keccak256(
                    abi.encodePacked(
                        blockhash(block.number - 1),
                        address(i_registry),
                        uint32(oldNonce)
                    )
                )
            );
            emit UpkeeperID(upkeepID);
            // DEV - Use the upkeepID however you see fit
            // link = 0x326C977E6efc84E512bB9C30f76E30c160eD06FB, 
            // registar = 0x9806cf6fBc89aBF286e8140C42174B94836e36F2, 0x29BA782aC65C22a43F6Fe358aF077aA906cD6c86
            // registry = 0x02777053d6764996e594c3E88AF1D58D5363a2e6
            // random = 0x2ca8e0c643bde4c2e08ab1fa0da3401adad7734d
