        BigNumber memory e = hex"010001".init(false);

        BigNumber memory nn = hex"".init(false);

        result = S.add(nn);
    }

    function test2() public view returns(BigNumber memory result) {
        bytes memory Msg = hex'68656c6c6f20776f726c64'; // "hello world" in hex

        BigNumber memory S = hex"079bed733b48d69bdb03076cb17d9809072a5a765460bc72072d687dba492afe951d75b814f561f253ee5cc0f3d703b6eab5b5df635b03a5437c0a5c179309812f5b5c97650361c645bc99f806054de21eb187bc0a704ed38d3d4c2871a117c19b6da7e9a3d808481c46b22652d15b899ad3792da5419e50ee38759560002388".init(false);

        BigNumber memory e = hex"010001".init(false);

        BigNumber memory nn = hex"".init(false);

        result = S.add(nn);
    }

    function verifyMembershipZKP(
        bytes memory _ciphertext, 
        bytes[][] memory proof,
        bytes[] memory validMessages,
        bytes[] memory _as,
        bytes memory _e,
        bytes memory pubKey
        ) external view returns(bool) {

            BigNumber memory cipher = BigNumbers.init(_ciphertext, false);
            BigNumber memory _pub = BigNumbers.init(pubKey, false);
            BigNumber memory _pub2 = _pub.mul(_pub);
            BigNumber[] memory AS = new BigNumber[](_as.length);
            for (uint256 i = 0; i < _as.length; i++) {
                BigNumber memory uk = cipher.modmul(BigNumbers.init(_as[i], false), _pub2);
                AS[i]= (uk);
            }

            BigNumber memory eSum = BigNumbers.zero(); //hex"0000".init(false);
            for (uint256 i = 0; i < proof[0].length; i++) {
                BigNumber memory _i = BigNumbers.init(proof[0][i], false);
                eSum = (eSum.add(_i)).mod(_pub);
            }

            if (!eSum.eq(BigNumbers.init(_e, false))) {
                return false;
            }

           bool check = checkEvery(proof, AS, _pub);
           if (check) {
               return true;
           }
            return false;
    }

    function checkEvery(bytes[][] memory proof, BigNumber[] memory AS, BigNumber memory _pub) public view returns(bool) {
        BigNumber memory _pub2 = _pub.mul(_pub);
         for (uint256 i = 0; i < proof[2].length; i++) {
                BigNumber memory v = BigNumbers.init(proof[2][i], false);
                BigNumber memory ui = BigNumbers.init(proof[1][i], false);
                BigNumber memory ei = BigNumbers.init(proof[0][i], false);
                BigNumber memory ai = AS[i];

                BigNumber memory aie = BigNumbers.modexp(ai, ei, _pub2);
                BigNumber memory uiae = BigNumbers.modmul(ui, aie, _pub2);
                BigNumber memory vin = BigNumbers.modexp(v, _pub, _pub2);

                if (!(vin.eq(uiae))) {
                    return false;
                }
            }
            return true;
    }

    function verifyInvMod(bytes memory _gmk, bytes memory _N, bytes memory _r) public view returns(bool verify) {
        BigNumber memory gmk = BigNumbers.init(_gmk, false);
        BigNumber memory N = BigNumbers.init(_N, false);
        BigNumber memory r = BigNumbers.init(_r, false);
        verify = BigNumbers.modinvVerify(gmk, N, r);
    }

    function hash(
        string memory _text,
        uint _num,
        address _addr
    ) public pure returns (bytes32) {
        return keccak256(abi.encodePacked(_text, _num, _addr));
    }
}

